import logo from './logo.svg';
import './App.css';
import React from 'react';

class Professores extends React.Component
{
  constructor(props)
  {
    super(props);
  }
  render()
  {
    var profs = ['Arliones', 'Odilson'];
    console.log(profs.length);
    return (
      <h1>Professores</h1>
    );
  }
}

function App() {
  return (
    <div className="App">
      <Professores/>
    </div>
  );
}

export default App;
